import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';

import Dashboard from './components/Dashboard';
import SmallestNumberGame from'./components/Task1';
import MatchTheColumnGame from './components/Task2';
import FillInBlanksGame from './components/Task3';

const App = () => {
  return (
    <Router>

        <Route path="/" exact component={Dashboard} />
        <Route path="/task1" component={SmallestNumberGame} />
        <Route path="/task2" component={MatchTheColumnGame} />
        <Route path="/task3" component={FillInBlanksGame} />

    </Router>
  );
};

export default App;
